// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract DataEntry {
    struct Entry {
        uint id;
        string data;
        address owner;
    }

    mapping(uint => Entry) public entries;
    uint public entryCount;

    event EntryCreated(uint id, string data, address owner);
    event EntryUpdated(uint id, string data);
    event EntryDeleted(uint id);

    function createEntry(string memory _data) public {
        entryCount++;
        entries[entryCount] = Entry(entryCount, _data, msg.sender);
        emit EntryCreated(entryCount, _data, msg.sender);
    }

    function updateEntry(uint _id, string memory _data) public {
        Entry storage entry = entries[_id];
        require(entry.owner == msg.sender, "Only the owner can update this entry");

        entry.data = _data;

        emit EntryUpdated(_id, _data);
    }

    function deleteEntry(uint _id) public {
        Entry storage entry = entries[_id];
        require(entry.owner == msg.sender, "Only the owner can delete this entry");

        delete entries[_id];

        emit EntryDeleted(_id);
    }
}
